import React from "react";
import { Route } from "react-router-dom";
import Nav from "./Nav";
import SubNav from "./SubNav";

function NavWrapper(props) {
  console.log(Object.keys(props.navInfo));
  return (
    <>
      <nav>
        {!props.navInfo ? (
          <div>Loading...</div>
        ) : (
          Object.keys(props.navInfo).map((value, index) => (
            <Nav key={index} navInfo={value} />
          ))
        )}
      </nav>
      {!props.navInfo ? (
        <div>Loading...</div>
      ) : (
        Object.keys(props.navInfo).map((value, index) => (
          <Route
            path={`/${value}/`}
            render={props => <SubNav navInfo={Object.values(props.navInfo)} />}
          />
        ))
      )}
      <Route path="/Mac/" render={props => <SubNav />} />
    </>
  );
}

export default NavWrapper;
